import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faWhatsapp, faGithub } from '@fortawesome/free-brands-svg-icons';
import { faEnvelope, faHouse } from '@fortawesome/free-solid-svg-icons';
import '../Css/Pengalamansaya.css';
import Tentangsaya from '../Assets/Tentangsaya.png';



const Header = () => {

  return (
    <div className="tentangsaya">
        <Container>
            <Row>
                <Col xs={12}>
                <h1><span className='text-yellow'>Pengalaman</span> Saya</h1>

                <div className='cover mt-5'>
                    <div className='tahun'>
                        <p className='text-purple fwb'>2022 - 2023</p>
                    </div>
                    <div className='konten'>
                        <div className='judul-konten text-purple'>
                            <h3>PT Spero Mahakarya</h3>
                            <p>Praktek Kerja Lapangan</p>
                        </div>
                        <hr style={{ border: "2px solid #FFFFFF", width: "100%", margin: "0" }} />
                        <ul>
                            <li>Menjadi Fullstack Developer menggunakan Framework Laravel</li>
                            <li>Membuat tampilan Website pengguna</li>
                            <li>Mengatur output data yang akan dilihat oleh pengguna</li>
                            <li>Mengolah data, seperti Filtering, Searching, DLL</li>
                            <li>Membuat CRUD sederhana</li>
                        </ul>
                        <p>
                            
                            
                            
                            
                            
                        </p>
                    </div>

                       
                </div>
                </Col>
            </Row>
        </Container>
    </div>
  );
}

export default Header;
